import React from "react";

function RecipeCard(props) {
    return (
        <div>
            <h2>{props.name}</h2>
            <p>Preparation Time: {props.prep_time}</p>
            <ul>
            {recipe.ingredients.map((ingredient) => (
                <li key={ingredient}>{ingredient}</li>
            ))}
            </ul>
            <p>{recipe.link}</p>
        </div>
      );
}

export default RecipeCard;
